apiVersion: unikorn.eschercloud.ai/v1alpha1
kind: HelmApplication
metadata:
  name: cert-manager
spec:
  name: Jetstack cert-manager
  description: |-
    Jetstack cert-manager provides declarative X.509 certificate management.
    Certificates can be signed with a manaually specified CA, or via an ACME
    protocol compliant CA e.g. Let's Encrypt. Jetstack cert-manager allows
    automatic key rotation and certificate injection into ingress resources
    for example.
  documentation: https://cert-manager.io/
  license: Apache-2.0 License
  icon: 
  tags:
  - security
  - networking
  exported: true
  versions:
  - version: v1.12.4
    repo: https://charts.jetstack.io
    chart: cert-manager
    release: cert-manager
    createNamespace: true
    parameters:
    - name: installCRDs
      value: "true"
    recommends:
    - name: cert-manager-issuers
---
apiVersion: unikorn.eschercloud.ai/v1alpha1
kind: HelmApplication
metadata:
  name: cert-manager-issuers
spec:
  name: Eschercloud AI Issuers for cert-manager
  description: |-
    Provides a default set of cluster-wide issuers for use with Jetstack cert-manager.
    These include Let's Encrypt staging and production servers.
  documentation: https://cert-manager.io/
  license: Apache-2.0 License
  icon: 
  tags:
  - security
  - networking
  exported: true
  versions:
  - version: 1.0.0
    repo: https://eschercloudai.github.io/helm-addons
    chart: cert-manager-issuers
    dependencies:
    - name: cert-manager
---
apiVersion: unikorn.eschercloud.ai/v1alpha1
kind: HelmApplication
metadata:
  name: vcluster
spec:
  name: Loft vCluster
  description: |-
    Loft vCluster provides virtual Kubernetes clusters that allow multi-tenant isolation
    and efficient resource utilisation.
  documentation: https://loft.sh/docs/virtual-clusters/what-are-virtual-clusters
  license: Apache-2.0 License
  icon: 
  tags:
  - security
  - infrastructure
  versions:
  - version: 0.15.7
    repo: https://charts.loft.sh
    chart: vcluster
    release: vcluster
    parameters:
    - name: hostpathMapper.enabled
      value: 'true'
---
apiVersion: unikorn.eschercloud.ai/v1alpha1
kind: HelmApplication
metadata:
  name: cluster-api
spec:
  name: Cluster API
  description: |-
    Cluster API provides declarative Kubernetes cluster provisioning in Kubernetes.
  documentation: https://cluster-api.sigs.k8s.io/
  license: Apache-2.0 License
  icon: 
  tags:
  - infrastructure
  versions:
  - version: v0.1.10
    repo: https://eschercloudai.github.io/helm-cluster-api
    chart: cluster-api
    interface: 1.0.0
---
apiVersion: unikorn.eschercloud.ai/v1alpha1
kind: HelmApplication
metadata:
  name: cilium
spec:
  name: Isovalent Cilium
  description: |-
    Isovalent Cilium provides a Container Network Interface (CNI) provider that
    offers industry leading performance, observability and security through Linux
    kernel eBPF extensions.
  documentation: https://cilium.io/
  license: Apache-2.0 License
  icon: 
  tags:
  - networking
  - security
  versions:
  - version: 1.14.1
    repo: https://helm.cilium.io
    chart: cilium
    parameters:
    - name: hubble.relay.enabled
      value: 'true'
    - name: hubble.ui.enabled
      value: 'true'
    - name: operator.setNodeTaints
      value: 'false'
    interface: 1.0.0
---
apiVersion: unikorn.eschercloud.ai/v1alpha1
kind: HelmApplication
metadata:
  name: cluster-openstack
spec:
  name: Cluster API Kubernetes Cluster for OpenStack
  description: |-
    Provides an opinionated Kuberenetes cluster deployment for Cluster API's
    OpenStack plugin.
  documentation: https://github.com/eschercloudai/helm-cluster-api/
  license: Apache-2.0 License
  icon: 
  tags:
  - infrastructure
  versions:
  - version: v0.3.26
    repo: https://eschercloudai.github.io/helm-cluster-api
    chart: cluster-api-cluster-openstack
    createNamespace: true
    interface: 1.0.0
---
apiVersion: unikorn.eschercloud.ai/v1alpha1
kind: HelmApplication
metadata:
  name: openstack-cloud-provider
spec:
  name: OpenStack Cloud Provider
  description: |-
    Provides basic functionality, including load-balancer support, for Kubernetes
    clusters hosted on OpenStack infrastructure.
  documentation: https://github.com/kubernetes/cloud-provider-openstack/blob/master/docs/openstack-cloud-controller-manager/using-openstack-cloud-controller-manager.md
  license: Apache-2.0 License
  icon: 
  tags:
  - infrastructure
  versions:
