    repo: https://kubernetes.github.io/cloud-provider-openstack
    chart: openstack-cloud-controller-manager
    createNamespace: true
    interface: 1.0.0
---
apiVersion: unikorn.eschercloud.ai/v1alpha1
kind: HelmApplication
metadata:
  name: openstack-plugin-cinder-csi
spec:
  name: OpenStack Cloud Provider Cinder CSI Plugin
  description: |-
    Provides Kubernetes cluster integration with Cinder block storage for Kubernetes
    clusters hosted on OpenStack infrastructure.
  documentation: https://github.com/kubernetes/cloud-provider-openstack/blob/master/docs/cinder-csi-plugin/using-cinder-csi-plugin.md
  license: Apache-2.0 License
  icon: 
  tags:
  - infrastructure
  - storage
  versions:
  - version: 2.28.0
    repo: https://kubernetes.github.io/cloud-provider-openstack
    chart: openstack-cinder-csi
    createNamespace: true
    interface: 1.0.0
    parameters:
    # Note this reuses the one generated by the cloud controller manager.
    - name: secret.enabled
      value: 'true'
    - name: secret.name
      value: cloud-config
    - name: secret.hostMount
      value: 'false'
---
apiVersion: unikorn.eschercloud.ai/v1alpha1
kind: HelmApplication
metadata:
  name: metrics-server
spec:
  name: Kubernetes Metrics Server
  description: |-
    Provides basic metrics for Kubernetes resources, including Pod CPU and memory
    utilisation used for Horizontal Pod Autoscaling (HPA).
  documentation: https://github.com/kubernetes-sigs/metrics-server
  license: Apache-2.0 License
  icon: 
  tags:
  - monitoring
  versions:
  - version: 3.11.0
    repo: https://kubernetes-sigs.github.io/metrics-server
    chart: metrics-server
    interface: 1.0.0
    parameters:
    - name: args[0]
      value: --kubelet-insecure-tls
---
apiVersion: unikorn.eschercloud.ai/v1alpha1
kind: HelmApplication
metadata:
  name: nvidia-gpu-operator
spec:
  name: NVIDIA GPU Operator
  description: |-
    Provides Kubernetes integration with NVIDIA GPUs.
  documentation: https://github.com/NVIDIA/gpu-operator
  license: Apache-2.0 License
  icon: 
  tags:
  - infrastructure
  versions:
  - version: v23.6.1
    repo: https://helm.ngc.nvidia.com/nvidia
    chart: gpu-operator
    parameters:
    - name: validator.plugin.env[0].name
      value: "WITH_WORKLOAD"
    - name: validator.plugin.env[0].value
      value: f
    interface: 1.0.0
---
apiVersion: unikorn.eschercloud.ai/v1alpha1
kind: HelmApplication
metadata:
  name: cluster-autoscaler
spec:
  name: Kubernetes Cluster Autoscaler
  description: |-
    Provides Kubernetes cluster node autoscaling.
  documentation: https://github.com/kubernetes/autoscaler/tree/master/cluster-autoscaler
  license: Apache-2.0 License
  icon: 
  tags:
  - infrastructure
  versions:
  - version: 9.29.3
    repo: https://kubernetes.github.io/autoscaler
    chart: cluster-autoscaler
    parameters:
    - name: cloudProvider
      value: clusterapi
    - name: clusterAPIMode
      value: kubeconfig-incluster
    - name: extraArgs.scale-down-delay-after-add
      value: 5m
    - name: extraArgs.scale-down-unneeded-time
      value: 5m
    - name: extraArgs.enforce-node-group-min-size
      value: 'true'
    - name: image.tag
      value: v1.27.2
    - name: rbac.serviceAccount.name
      value: cluster-autoscaler
    interface: 1.0.0
---
apiVersion: unikorn.eschercloud.ai/v1alpha1
kind: HelmApplication
metadata:
  name: cluster-autoscaler-openstack
spec:
  name: Kubernetes Cluster Autoscaler OpenStack Addons
  description: |-
    Provides OpenStack specific addons that enable Kubernetes Cluster Autoscaler
    scale-from-zero support.
  documentation: https://github.com/eschercloudai/helm-cluster-api/
  license: Apache-2.0 License
  icon: 
  tags:
  - infrastructure
  versions:
  - version: v0.1.0
    repo: https://eschercloudai.github.io/helm-cluster-api
    chart: cluster-api-cluster-autoscaler-openstack
---
apiVersion: unikorn.eschercloud.ai/v1alpha1
kind: HelmApplication
metadata:
  name: ingress-nginx
spec:
  name: Kubernetes Ingress Nginx Controller
  description: |-
    Provides support for Kubernetes ingress resources using the Nginx webserver.
  documentation: https://kubernetes.github.io/ingress-nginx/
  license: Apache-2.0 License
  icon: 
  tags:
  - networking
  exported: true
  versions:
  - version: 4.8.0
    repo: https://kubernetes.github.io/ingress-nginx
    chart: ingress-nginx
    createNamespace: true
    parameters:
    - name: controller.service.annotations.unikorn\.eschercloud\.ai/ingress-endpoint
      value: 'true'
    - name: controller.kind
      value: DaemonSet
    - name: controller.enableAnnotationValidations
      value: 'true'
    recommends:
    - name: cert-manager
---
apiVersion: unikorn.eschercloud.ai/v1alpha1
kind: HelmApplication
metadata:
  name: kubernetes-dashboard
spec:
  name: Kubernetes Dashboard
  description: |-
    Provides basic navigation and management of resources in a Kubernetes cluster.
  documentation: https://github.com/kubernetes/dashboard
  license: Apache-2.0 License
  icon: 
  tags:
  - monitoring
  - management
  exported: true
  versions:
  - version: 6.0.8
    repo: https://kubernetes.github.io/dashboard
    chart: kubernetes-dashboard
    interface: 1.0.0
    dependencies:
    - name: cert-manager
    - name: cert-manager-issuers
    - name: ingress-nginx
---
apiVersion: unikorn.eschercloud.ai/v1alpha1
kind: HelmApplication
metadata:
  name: longhorn
spec:
  name: Longhorn
  description: |-
    Provides an alternative replicated storage provider that distributes storage across
    the Kubernetes cluster.  Features high-availabilty, incremental snapshots and backups,
    disaster recovery, and shared file mounts (read/write many).
  documentation: https://longhorn.io/
  license: Apache-2.0 License
  icon: 
  tags:
  - storage
  exported: true
  versions:
  - version: 1.5.3
    repo: https://charts.longhorn.io
    chart: longhorn
    createNamespace: true
    parameters:
    - name: defaultSettings.kubernetesClusterAutoscalerEnabled
      value: 'true'
    - name: persistence.defaultClass
      value: 'false'
    # See https://github.com/longhorn/longhorn/issues/6415 for further details.
    - name: helmPreUpgradeCheckerJob.enabled
      value: 'false'
---
apiVersion: unikorn.eschercloud.ai/v1alpha1
kind: HelmApplication
metadata:
  name: kube-prometheus-stack
spec:
  name: Kubernetes Prometheus Stack
  description: |-
    Priovides basic Prometheus logging with the Prometheus Operator. This application
    only installs Prometheus server, and Prometheus Operator that can then be declaratively
    configured with custom resources to collect metrics.
  documentation: https://prometheus-operator.dev/
  license: Apache-2.0 License
  icon: 
  tags:
  - monitoring
  exported: true
  versions:
  - version: 50.2.0
    repo: https://prometheus-community.github.io/helm-charts
    chart: kube-prometheus-stack
    createNamespace: true
    serverSideApply: true
    parameters:
    - name: defaultRules.create
      value: 'false'
    - name: alertmanager.enabled
      value: 'false'
    - name: grafana.enabled
      value: 'false'
    - name: kubernetesServiceMonitors.enabled
      value: 'false'
    - name: kubeStateMetrics.enabled
      value: 'false'
    - name: nodeExporter.enabled
      value: 'false'
    - name: prometheus.enabled
      value: 'false'
